                <h1>¡Volveremos pronto!</h1>
                <p>Nuestro sitio está actualmente en mantenimiento. Le agradecemos su paciencia y le invitamos a volver en breve.</p>
            </div>
        </div>
    );
};

export default MaintenancePage;
